import { Box, Container, Grid, Link } from "@mui/material";
import { red } from "@mui/material/colors";
export const Footer = () => {
  return (
    <>
      <Box px={ {sx: 3, sm: 10}}
      bgcolor={red}>
        <Container maxWidth="lg">
          <Grid container spacing={5}>
            <Grid item xs={12} sm={4}>
              <Box borderBottom={1}>Help</Box>
              <Box>
                <Link >Contact</Link>
              </Box>
              <Box>
                <Link>lol</Link>
              </Box>
            </Grid>
          </Grid>
        </Container>
      </Box>
      ;
    </>
  );
};
